import './App.css';
import Logo from './statics/LOGO.png';
import Header from './components/Header';

function App() {
  return (
    <main class="App">
      <Header></Header>
      <div class="content">
        <div class="contant-firstline">
          <img class="flag-logo" src={ Logo } alt="Logo"/>

        </div>
      </div>
    </main>
  );
}

export default App;
